	    StringUtils.StringBuilderAppend(strBufStack.Peek(), scanner.EncapsedStringBuffer, value_stack.array[value_stack.top-1].yyval.Offset, value_stack.array[value_stack.top-1].yyval.Integer); 
	    yyval.Object = value_stack.array[value_stack.top-2].yyval.Object;
	  }
        return;
      case 554: // composite_string_opt -> composite_string_opt T_CHARACTER 
{ 
	    strBufStack.Peek().Append((int)value_stack.array[value_stack.top-1].yyval.Integer); 
	    yyval.Object = value_stack.array[value_stack.top-2].yyval.Object;
	  }
        return;
      case 555: // composite_string_opt -> composite_string_opt '[' 
{ strBufStack.Peek().Append('['); yyval.Object = value_stack.array[value_stack.top-2].yyval.Object; }
        return;
      case 556: // composite_string_opt -> composite_string_opt ']' 
{ strBufStack.Peek().Append(']'); yyval.Object = value_stack.array[value_stack.top-2].yyval.Object; }
        return;
      case 557: // composite_string_opt -> composite_string_opt '{' 
{ strBufStack.Peek().Append('{'); yyval.Object = value_stack.array[value_stack.top-2].yyval.Object; }
        return;
      case 558: // composite_string_opt -> composite_string_opt '}' 
{ strBufStack.Peek().Append('}'); yyval.Object = value_stack.array[value_stack.top-2].yyval.Object; }
        return;
      case 559: // composite_string_opt -> composite_string_opt T_OBJECT_OPERATOR 
{ 
	    strBufStack.Peek().Append("->");
	    yyval.Object = value_stack.array[value_stack.top-2].yyval.Object;
	  }
        return;
      case 560: // composite_string_opt -> 
{ 
	    yyval.Object = new List<Expression>(); 
	    strBufStack.Push(new PhpStringBuilder(sourceUnit.Encoding, false, strBufSize)); 
	  }
        return;
      case 561: // string_embedded_variable -> T_VARIABLE 
{ 
			yyval.Object = new DirectVarUse(yypos, (string)value_stack.array[value_stack.top-1].yyval.Object); 
		}
        return;
      case 562: // @21 -> 
{ strBufStack.Push(new PhpStringBuilder(sourceUnit.Encoding, false, strBufSize)); }
        return;
      case 563: // string_embedded_variable -> T_VARIABLE '[' @21 string_embedded_key ']' 
{
			strBufStack.Pop();
			yyval.Object = new ItemUse(yypos, new DirectVarUse(yypos, (string)value_stack.array[value_stack.top-5].yyval.Object),(Expression)value_stack.array[value_stack.top-2].yyval.Object);
		}
        return;
      case 564: // string_embedded_variable -> T_VARIABLE T_OBJECT_OPERATOR T_STRING 
{ 
			yyval.Object = new DirectVarUse(value_stack.array[value_stack.top-1].yypos, scanner.GetEncapsedString(value_stack.array[value_stack.top-1].yyval.Offset,value_stack.array[value_stack.top-1].yyval.Integer)); 
			((DirectVarUse)yyval.Object).IsMemberOf = new DirectVarUse(value_stack.array[value_stack.top-3].yypos, (string)value_stack.array[value_stack.top-3].yyval.Object); 
		}
        return;
      case 565: // string_embedded_variable -> T_DOLLAR_OPEN_CURLY_BRACES expr '}' 
{ 
		  yyval.Object = new IndirectVarUse(yypos, 1, (Expression)value_stack.array[value_stack.top-2].yyval.Object); 
		}
        return;
      case 566: // string_embedded_variable -> T_DOLLAR_OPEN_CURLY_BRACES T_STRING_VARNAME '[' expr ']' '}' 
{ 
			yyval.Object = new ItemUse(yypos, new DirectVarUse(yypos, scanner.GetEncapsedString(value_stack.array[value_stack.top-5].yyval.Offset,value_stack.array[value_stack.top-5].yyval.Integer)), (Expression)value_stack.array[value_stack.top-3].yyval.Object); 
		}
        return;
      case 567: // string_embedded_variable -> T_CURLY_OPEN chain '}' 
{ 
		  yyval.Object = value_stack.array[value_stack.top-2].yyval.Object; 
		}
        return;
      case 568: // string_embedded_key -> T_STRING 
{ 
			/* Constants are not looked for within strings */
			yyval.Object = new StringLiteral(yypos, scanner.GetEncapsedString(value_stack.array[value_stack.top-1].yyval.Offset,value_stack.array[value_stack.top-1].yyval.Integer));
		}
        return;
      case 569: // string_embedded_key -> T_NUM_STRING 
{ 
			yyval.Object = new StringLiteral(yypos, scanner.GetEncapsedString(value_stack.array[value_stack.top-1].yyval.Offset,value_stack.array[value_stack.top-1].yyval.Integer)); 
		}
        return;
      case 570: // string_embedded_key -> T_VARIABLE 
{ 
	  yyval.Object = new DirectVarUse(yypos, (string)value_stack.array[value_stack.top-1].yyval.Object); 
	}
        return;
    }
  }

  protected override string TerminalToString(int terminal)
  {
    if (((Tokens)terminal).ToString() != terminal.ToString())
      return ((Tokens)terminal).ToString();
    else
      return CharToString((char)terminal);
  }


